import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from "./App";
import * as serviceWorker from './serviceWorker';
import { Server } from 'miragejs';

new Server({
    routes() {
        this.namespace = 'api';

        this.get('/movies', () => {
            return [
                { id: 1, name: 'Inception', year: 2010 },
                { id: 2, name: 'Interstellar', year: 2014 },
                { id: 3, name: 'Dunkirk', year: 2017 }
            ]
        });

        this.get('/restaurants', () => {
            return [
                {id: 1, name: 'Kentucky Fried Chicken', phone: '+36 1 610 5717', distance: '0.75 km'},
                {id: 2, name: 'Burger King', phone: '+36 70 452 3457', distance: '0.85 km'},
                {id: 3, name: 'Salt and Pepper', phone: '+36 70 622 6277', distance: '2.3 km'}
            ]
        });
    }
});

ReactDOM.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>,
  document.getElementById('root')
);

// If you want your app to work offline and load faster, you can change
// unregister() to register() below. Note this comes with some pitfalls.
// Learn more about service workers: https://bit.ly/CRA-PWA
serviceWorker.unregister();
